R["oh__@kessira26"]="{['TS']=1727058685,['Key']='oh__@kessira26',['na']={[4]={['N']='Flarrion\\'s Room',['O']=19866,['C']=1.500000,['D']='Welcome to Flarrion\\'s Room, a cozy little apartment with a loft and home to Flarrion, sister of Flessani (who is currently living in the Snugpod). They are both a bit overconcerned about having enough food, but Flarrion, living in an Inn as she does, takes it less seriously. ',},[5]={['N']='Mnementhe\\'s Nook',['O']=19866,['C']=1.500000,['D']='Welcome to Mnementhe\\'s cozy nook. An apartment room at the Sisters of the Sands inn. The decorating style is a bit unique, but then again, so is Mnementhe. And for those Anne McCaffrey readers, yes I did name my DragonKnight after a Dragon.  ',},[6]={['N']='The Colorful Retreat',['O']=19424,['C']=1.025000,['D']='Welcome to the Colorful Retreat. A bright and glowing place in the middle of the city to escape, sit down with friends or take a nap. Home to a local scholar the previously dark and grim room has been transformed into a colorful and bright space full of magic and mystery. ',},[7]={['N']='Skyseer\\'s Cottage',['O']=19855,['C']=1.500000,['D']='The cozy cottage of my Altmer adventurer Rowan Skyseer. ',},[10]={['N']='Exile\\'s Home',['O']=19446,['C']=1.500000,['D']='A tiny and colorful home for an exiled adventurer. The backyard is still accessible by clicking between the curtains hanging over the door.',},[11]={['N']='Sao\\'s Dwelling',['O']=19874,['C']=1.500000,['D']='Welcome to the home of my Bosmer Warden Sao. Sao inherited the home from an elderly Argonian botanist who saved him as a baby and raised him for a time. Sao still carefully cares for the Mimic Hist Tree that his surrogate father bred and kept hidden in the house. ',},[13]={['N']='Flessani\\'s Home',['O']=19855,['C']=1.500000,['D']='The cozy little house of my Bosmer adventurer Flessani. Having been raised amoung Breton\\'s she doesn\\'t follow the Green Pact, but is eager to learn of her heritage and wanted to try living in one of the tiny Bosmer pod homes. No one has told her yet she\\'s doing it wrong, bless her. ',},[15]={['N']='Greenseer House',['O']=19890,['C']=1.500000,['D']='What happens when a greenspeaker falls hopelessly in love with a Ayleid Ruin fanatic and tries to create a home for him? Welcome to Greenseer house, the love gift from one Elf to another. Created by pulling up pieces of an Ayleid Ruin and growing them together into some semblance of a home.',},[16]={['N']='Cozy Abode',['O']=19816,['C']=1.025000,['D']='Karal-dro Tomeseer\\'s cozy little home, with everything a wandering arcanist Khajiit might need, including copious shelving for books and a quiet nook for studying. Do not ask what Karal-dro is doing in Glenumbra, this one does not wish to have to erase your memories, yes? The process is so...unreliable. Sometimes just the relevant things go...sometimes a bit more. ',},[98]={['N']='Systres Lighthouse',['O']=19471,['C']=1.018000,['D']='Fogbreak Isle was purchased by a retired mercenary group, determined to live a comfortable life now that they no longer tramped the wilds. Attached to the lighthouse, this sprawling manor boasts an extensive multi-level library, a formal dining room, several sitting rooms and a secret hotsprings. The bedrooms offer stunning views of the ocean and nearby islands. ',},[70]={['N']='Khajiiti Historical',['O']=19645,['C']=1.030000,['D']='The Khajiiti Historical Cliffside Museum and Study, belongs to a small group of people, dedicated to the preservation and restoration of Khajiiti monuments and Art. The sprawling place boasts several restored monuments, as well as a study area, kitchen and dining, and multiple rooms for guests or permanent residents. It even has a built in escape route in case Rimmen should once again be overtaken. Come explore the Khajiiti Historical',},[71]={['N']='Castle SanitatemAqui',['O']=19932,['C']=1.014000,['D']='Welcome to Sanitatem Aqui, the healing waters. This fortification was once built to protect the sacred healing waters, but it has since been turned into an Inn and Spa resort, currently home to an adventuring mercenary group. Enjoy the bath\\'s, take in the beautiful rooftop gardens or enjoy a spot of fishing with Sharp. All are welcome.',},[104]={['N']='Arcanist\\'s Hideaway',['O']=19638,['C']=1.020000,['D']='Welcome to my humble little Arcanist Hideaway, full of curiousities and magic. ',},[105]={['N']='Tree King\\'s Throne',['O']=19784,['C']=1.020000,['D']='The Tree King\\'s Throne is a small community of Druids protecting a very powerful forest spirit that likes to masquerade about as a man. Take a stroll through the enchanted wood, and find the Druidic greathall, where the village gather\\'s to eat and work together. Hidden behind the Druid King\\'s Sentinal and guarded by a ferious beast, you can find the idylic bathing pools that the Druids use. Up the steps and to the right, find the Throne of the Tree King and his eccentric dwelling. ',},[111]={['N']='Seabloom Bakery',['O']=19972,['C']=1.021000,['D']='Welcome to the Seabloom Bakery, specializing in cakes for large events. Stop by our tasting room to sample our delicious cakes and choose one for your own special event. You\\'ll find our cakes quite ridiculously delicious and worth every world boss you have to evade on the way here. ',},[80]={['N']='The Eclectic Family ',['O']=19302,['C']=1.036000,},[81]={['N']='The Hjaalmarch Witch',['O']=19661,['C']=1.023000,['D']='The Home of the Hjaalmarch Witch. Enter at your own risk! Take a journey out the back door and climb the path up death mountain, then slide through the vortex into the cave of mystery and find the hidden chamber of torture. Can you escape? The way out is hidden behind Bastian\\'s Torment and to the left of Dagon\\'s Mercy. Slip through the crack and then with just a hop, a skip and a jump, you\\'ll be back at the beginning. Happy Halloween!',},[82]={['N']='Castle in the Sky',['O']=19084,['C']=1.020000,['D']='Welcome to my Castle in the Sky, magic floating castle. A bit less castle-y than I intended, but beautiful I think, none-the-less. This single-story dwelling floats among the endless sky of Shalidor\\'s pocket realm. Featuring gardened area\\'s for peaceful contemplation, a cozy reading area, dining room and fully furnished kitchen, this single bedroom dwelling is perfect for entertaining. Additional guest bedrooms are availble in the nearby castle ruins. Please come, visit and enjoy.',},[19]={['N']='Faeloehn\\'s Flat',['O']=19874,['C']=1.500000,['D']='The cozy and bright home of my Dunmer Templar Faeloehn Brightsoul. The decor reflects both her pious nature and her love for green growing things',},[73]={['N']='Ocean View Home',['O']=19908,['C']=1.500000,['D']='An oddly built home, designed for relaxation and beautiful ocean views, this place serves as a respite for my dear Khajiit adventurer and her companion. ',},[22]={['N']='Soircha\\'s Hideaway',['O']=19866,['C']=1.500000,['D']='The secret hideaway of Soircha Sanguine. Ever wonder how a nice peaceful vampire lives? Welcome to Soircha\\'s little brightly lit home. Her favorite beverages are drunk Men or Mer and Khajiit who have imbibed a bit too much Moonsugar. No Scooma though, that\\'s nasty stuff! Never fear, all her beverages are quite willing to part with a pint or two to help the cause!',},[103]={['N']='Swordstar Holding',['O']=19849,['C']=1.500000,['D']='Welcome to the Swordstar Holding, the home of the Swordstar Mercenary group. After long campaigns abroad, the Swordstar group returns home to soak in the sun and soak in the cooling waters. The spread out nature of the Holding allows for tempers to cool between members and gives ample space for relaxation and off season hobbies. ',},[60]={['N']='Wayfarer\\'s Inn ',['O']=19701,['C']=1.025000,['D']='When the Moonbright scholars had a chance to purchase some land not far from Sunhold they were thrilled. It seemed the ideal place to build their library and eventually their school. Little did they know, what they had purchased was a troublesome cavern, frequented by pirates, smugglers and sailors of all sorts. The Wayfarer Inn is their answer to the quandry. Built high in the dome of the cavern, the Inn and their libary are safe from trespassers and bring in some money too.',},[25]={['N']='Jareth\\'s House',['C']=1.500000,['O']=19989,['D']='The home of my Alter Vampire Jareth Silver-eye. The neighbors weren\\'t too sure what to think when this vampire moved in next door, but since he only drinks blood during battle and is otherwise a very peaceable neighbor, they\\'ve all come to accept him over time. ',},[90]={['N']='Chardom Hotsprings',['O']=19673,['C']=1.014000,['D']='Are you weary from your travel\\'s through Malabal Tor, need to soak away your troubles? Then Chardom Hotsprings is for you. Located not far from the Drabul Wayshrine and a very short walk from the nearby road, Chardom Hotsprings is an ideal side jaunt to relax, refresh yourself and wash away the dust of your travels. Fear not to step through the sinister looking portal, for on the otherside you will find a singularly warm and inviting oasis. Men to the right, women to the left. All are welcome!',},[91]={['N']='Blue Retreat',['O']=19773,['C']=1.021000,['D']='Welcome to the Blue Retreat. A calming oasis, right on the border of Elsweyr and Blackwood. Enjoy the beautiful views from this custom built house or sit back and relax by the water. ',},[28]={['N']='Sjofun\\'s Holding',['O']=19874,['C']=1.500000,['D']='Welcome to the home of Sjofun Sigurdson, my Nord Arcanist and his Dunmer Arcanist husband. They both swear they hated living in Apocrypha, as they did for a time, and couldn\\'t wait to move back to somewhere with normal seasons and yet...the decor of their current home indicates otherwise. ',},[34]={['N']='Tatius\\' House',['O']=19874,['C']=1.500000,['D']='Welcome to the home of Tatius Lightening my Imperial Sorcerer. Come for a visit, he\\'ll talk your ear off about ancient wonders and modern techonology. Pets are welcome, but please no unattended children in the pool area. ',},[94]={['N']='Maighdean Mhara ',['O']=19569,['C']=1.012000,['D']='The Mermaid\\'s Abode. The secret lair of a mermaid. She never lures sailors down into the depths of her home, it\\'s perfectly safe. Honest! Scuba gear or self air cycling magic bubble required. Or you know, hold your breath for a really, really long time!',},[31]={['N']='House of Moonfeahr',['O']=19912,['C']=1.500000,['D']='Welcome to Moonfeahr House, a cozy little stone dwelling, filled with the light of a flower garden. Moonfeahr Nightmaeden can no longer walk to warm sunny garden\\'s of her childhood, so she has brought them into her home instead. ',},},['Version']=1773,}"
