R["oh__@dekafox"]="{['Version']=1773,['na']={[80]={['C']=1.051000,['N']='Snow Cat Sanctuary',['O']=19708,['D']='Here and there, one hears whispers of a khajiit ice witch who has made a sanctuary for herself at a hidden lake in western Skyrim. Those few who visit speak of a mage\\'s tower of questionable construction that welcomes those who need to hide from the outside world, even if but for a moment. A well-stocked kitchen and common area with Tribute decks ready on hand, a library with books both mundane and exotic, not to mention a warded area to practice one\\'s magicks. But beware the ice caves!',},[49]={['C']=1.021000,['N']='Deathwhisper Cottage',['O']=19692,['D']='The \"cozy\" home of an Argonian necromancer from the Black Marsh.',},[30]={['C']=1.021000,['N']='Hunter\\'s Rest',['O']=19692,['D']='The perfectly ordinary house of a fine upstanding templar. Pay no mind to the books laying around, or the wolves - they\\'re quite friendly, as long as guests behave themselves. If you have any crafting needs, be sure to pay the fully-equipped workshop a visit! And if you notice anything odd about the hedges, don\\'t worry about it.  There\\'s nothing special back there, just some poison ivy.',},[43]={['C']=1.026000,['D']='Tucked away off one of Vvardenfell\\'s lakes is a gaming hall known as the Silver-Scale Retreat. Established by an Argonian lass who came into a fair amount of coin, it\\'s remote location offers privacy and discretion to those who visit. Among its amenities one can find a wide variety of games, a fully stocked bar for any tastes, no matter how obscure, and a dedicated tournament room for Tales of Tribute! But rumors persist of a darker side as well...',['O']=19986,['N']='Silver-Scale Retreat',},[100]={['C']=1.037000,['N']='Journey\\'s End Shrine',['O']=19906,['D']='With the temple in Necrom closed, some are opening their private shrines for worship and meditation.  This is one such small shrine, dedicated to the Tribunal.\\n\\nThe ending of the words is ALMSIVI.',},[61]={['C']=1.026000,['N']='Bloodmoon Hall',['O']=19812,['D']='Within this ruined tower lies Bloodmoon Hall, a refuge for all hunters. Here, one may find a fully stocked feast hall, perfect for boasting and filling ones belly. A portal within, however, unveils the Hall\\'s true purpose, as a gathering place... for werewolves! There, safely within Hircine\\'s sanctuary, they can wear their true skin and demonstrate their skills in contests of strength, re-attune themselves to the firmament to gain its gifts, or gather and pay homage to the greatest Hunter of all',},[78]={['C']=1.025000,['N']='Wolf\\'s Den Library',['O']=19792,['D']='Located in the heart of downtown Solitude, convieniently placed next to the Bard\\'s College is the Wolf\\'s Den library. Hundreds of books are here for your perusal, including a growing Daedric section for those in good standing with the Mage\\'s Guild.',},[41]={['C']=1.026000,['N']='Brass Caverns',['O']=19699,['D']='A long-buried Dwemer factory outpost was found and uncovered by a student of Sotha Sil\\'s clockwork technology. They managed to restore some of the machinery, but mysteriously disappeared before they could finish their work, and it was lost once more.  Now rediscovered again, this strange synthesis of clockwork and dwemer called the Brass Caverns awaits restoration once more.',},},['Key']='oh__@dekafox',['TS']=1726792579,}"
