R["oh__@kazahra"]="{['Version']=1773,['na']={[2]={['N']='Cats',['D']='Felis Catus\\n\\nComplimentary Reading: \"Ode to Spot\" -Data, TNG',['C']=1.500000,['O']=19972,},[100]={['N']='Sweetroll Cultists',['D']='Sweetroll Cultists\\n\\n\"Oh great Sweetroll Gods hear my plea\"\\n*Cultist chants*\\n\"Thou dough is buttery and thou spices delectable\"\\n*Cultist chants*\\n\"And thou art good at any temperature\"\\n*Cultist chants*\\n\"Grant my boon and guide my hand that I may purchase more of thy bounty\"\\n*Cultist chants*\\n{-Jezrael, High Priestess of Baked Goods}',['C']=1.044000,['O']=19973,},[6]={['N']='Time Machine',['D']='A Time Machine, inspired by H.G Wells. Includes a secret nod to the time-lapse dress shop scene from the 1960\\'s movie. You can sit in the device and switch the lighting to suit your mood. Happy adventures!',['C']=1.027000,['O']=19972,},[71]={['N']='Water Garden',['D']='Botanical Water Garden, SE corner MSM',['C']=1.021000,['O']=19972,},[40]={['N']='Tamriel Survivor',['D']='Survivor, Tamriel. Outwit, Outplay, Outlast! 16 Castaways, 39 Days, 1 Million Gold prize. Compete on the obstacle courses, puzzles and endurance challenges for rewards, immunity and the chance to win the title of \"Sole Survivor.\"  Survivor Camp, Auction, Spa/Sanctuary and Tribal Council included. Hidden Clue & Immunity Idol to find...There is a small installation from a screenshot contest (\"Make a boat out of Murkmire Bed, Enclosed\") as I didn\\'t have the heart to disassemble it.',['C']=1.018000,['O']=19972,},[73]={['N']='Hanging Gardens',['D']='Hanging Gardens and \"Terrace of Decadence.\" Reserve your bespoke balcony and daybed and settle in for a day and night of indulgence. Eat, drink, game and nap! Bask in the sun after swimming in the ocean below. Stay for a cocktail and frolic under the evening stars. Best viewed at night for an ideal view of the lighting and external architecture.',['C']=1.021000,['O']=19972,},[10]={['N']='Dhalmora House',['D']='Humble Zen',['C']=1.500000,['O']=19064,},[11]={['N']='Stibbons\\' Nightmare',['D']='STARTED: \"Stibbo Sleep\"\\n\\nYou receive a message from Lady Laurent. It seems her manservant Stibbons has gone missing. Last seen with his pack heading towards the alchemical garden of Alyxe the Hagraven. Has not quite been himself since the duplication incident in Blackwood, jibbering on about sleepless nights, elixirs and what not. Could you spare a moment to help find him? Lady Laurent is quite concerned. The tea is cold and the chores are really piling up...\\n\\nESO Grand Designs, Halloween 2022',['C']=1.044000,['O']=19973,},[77]={['N']='The Nothing',['D']='The Nothing & Gmork (The Neverending Story)',['C']=1.020000,['O']=19972,},[19]={['N']='Kragenmoor House',['D']='Butterfly House',['C']=1.021000,['O']=19973,},[87]={['N']='Honey Badger',['D']='Honey Badger Don\\'t Care',['C']=1.044000,['O']=19972,},[25]={['N']='Baandari House',['D']='One of the many gardens Druid Ryvana frequents to grow and process the variety of herbs, flowers and mushrooms for her tinctures, salves and potions. Feel free to inquire about her more adventurous concoctions, if you dare. Includes some humble and rustic cobbles of beehives, an insect hotel and hydroponics.',['C']=1.021000,['O']=19221,},[95]={['N']='Temple of Doom',['D']='Phedre and The Last Crusade',['C']=1.002000,['O']=19972,},[68]={['N']='Yoga Cats',['D']='Yoga Cats',['C']=1.044000,['O']=19972,},[8]={['N']='Marbruk House',['D']='The Crafty Raven Apothecary',['C']=1.500000,['O']=19204,},[4]={['N']='Close Encounters',['D']='Close Encounters',['C']=1.044000,['O']=19973,},[30]={['N']='Riften House',['D']='Create your own custom picnic basket and head outdoors to enjoy the sprawling green lawns and live music of the Old Mistveil Manor Estate. Or grab a cosy table indoors, enjoy some hearty food and snacks and get your game on with friends! ',['C']=1.021000,['O']=19055,},[31]={['N']='Dungeons & Dragons',['D']='D&D Room',['C']=1.007000,['O']=19972,},},['Key']='oh__@kazahra',['TS']=1725693617,}"
