R["oh__@setantacuchulainn"]="{['TS']=1724284533,['Version']=1773,['na']={[80]={['D']='Rkchuanzel was a small outpost originally established deep into the Druadach Mountains. It started as a workshop, using the lava from deep underground to forge the various Animunculi. As the area grew more dangerous due to the Nordic Invasions, the outpost was expanded to include some services and shared quarters. Over time, the outpost continued growing, and with the arrival of a Meridian Priest, everything changed...',['C']=1.026000,['O']=19956,['N']='Ruins of Rkchuanzel',},},['Key']='oh__@setantacuchulainn',}"
R["oh__@mythobstacleiv"]="{['na']={[1]={['N']='Vulkhel Guard Inn',['O']=19702,['C']=1.051000,['D']='The kids bunkroom, a cozy place for play or rest',},[2]={['N']='Captain\\'s Quarters',['D']='The Captains Quarters in Daggerfall. Schedule a meeting at the front please. ',['C']=1.025000,['O']=19956,},[3]={['N']='Argonian Libations',['O']=19956,['C']=1.024000,['D']='An Argonian themed bar, I hear the snake is delicious!',},[4]={['N']='Skywatch Apartment',['O']=19702,['C']=1.051000,['D']='A warm studio apartment with reading loft',},[5]={['N']='Alikr Lounge',['D']='Welcome to the Skooma Den of Sentinel! Please enjoy at your leisure. ',['C']=1.051000,['O']=19956,},[6]={['N']='Mournhold Apartment',['O']=19702,['C']=1.051000,['D']='An herbalists studio, and the perfect place to collect and study plants, or to rest and relax. ',},[98]={['N']='Shipwright\\'s Regret',['O']=19956,['C']=1.038000,['D']='A long abandoned harbor town at the old lighthouse. Mysteriously all the lights are still on, but with an eerie glow. There seems to be signs of pirates visiting, and old ships still in the harbor. Come visit and see what you may find, whether at the shipwreck or that music coming from up the hill. Just watch out for ghosts. ',},[68]={['N']='Rimmen Thrift Shop',['D']='The Sugar Bowl Shoppe awaits you, come by the browse the finest silks and spices!',['C']=1.041000,['O']=19956,},[87]={['N']='Leyawiin Bath House',['O']=19956,['C']=1.014000,['D']='Need a break from society? Come to this cozy and private bath house and rest your weary bones.',},[88]={['N']='Museum, or... cult?',['O']=19956,['C']=1.023000,['D']='What starts as a museum and collector\\'s showcase, turns into... something a bit more unsettling. What\\'s the constant sound... and whispers? Wait, I thought we were in Blackwood? Come see exactly what this house is up to. ',},[100]={['N']='Necrom Inn',['O']=19924,['C']=1.041000,['D']='This studio apartment is the perfect spot for a Necrom traveller to rest up.',},[42]={['N']='Vivec City Inn',['O']=19702,['C']=1.051000,['D']='Hlaalu styled library and penthouse suite',},[40]={['N']='Sharp\\'s Island House',['O']=19956,['C']=1.018000,['D']='Welcome to Sharp\\'s Jungle Island, filled with lush plants and plenty of place to rest by the water. Arrive at the pier, and stop by the fishing hall. Up the hill is the craft hall, trophy hall, and shop. Pay a visit to the hist tree by the pond. And lastly be sure to enjoy the coral reef spas that have formed from in the warm waters of the lavel spill. ',},[109]={['N']='Colovian Taste Room',['D']='The Rosewine Winery and Cheese House is open year round for visitors. Stop by and sample what wine we have in stock, and taste some of our finest in-house pressed cheeses.',['C']=1.041000,['O']=19956,},[77]={['N']='Solitude Tavern',['O']=19956,['C']=1.024000,['D']='A small local bar in Solitude off the beaten path. Stop by for a pint and hand made sausages. ',},[58]={['N']='Alinor Inn',['O']=19924,['C']=1.041000,['D']='A nice loft in the heart of Alinor',},[95]={['N']='Gonfalon Bay Inn',['O']=19924,['C']=1.025000,['D']='A private study for a notable sailor',},},['TS']=1724281235,['Version']=1773,['Key']='oh__@mythobstacleiv',}"
