R["oh__@polaroid_memories"]="{['TS']=1715690705,['Version']=1773,['Key']='oh__@polaroid_memories',['na']={[11]={['C']=1.037000,['N']='Temple of Ancestors',['D']='The Temple of Ancestors is an oasis of reverence surrounded by an extensive water garden, “The River of Life.” Visitors may enjoy the river’s several pools as they tour the lower level of the installation, but as with a lifespan, to see the totality in perspective may only be done from above, so to speak, in retrospect. Here such may be viewed from the upper level. Inside the gleaming edifice, in its obsidian underworld, what has been “urn-ed” after life ends now rests in peace—loved ones all.',['O']=19857,},},}"
