R["fx__eu__@ktartyk__98"]="{['Version']=1773,['TS']=1708938695,['Effects']={[1]={['Pitch']=5.323250,['Y']=19507,['Color']=102439,['MetaData']={['title']='Grandma\\'s final rest',['message']='this house is dedicated to my grandparents, and most of all, my grandma\\n\\nIn 2020, they had to leave their beloved old , rural, house, surounded by the square miles of their woods, and go to a \"generic\" house in the city\\nbecause of their age, they could not tend to the land anymore, despite grandpa\\'s stuborn nature\\n\\nin hindsight, they made the right call\\n\\nin june, this year, we learned that grandma had multiple myeloma, bone marrow cancer, and at such an advanced state, the doctors were giving her weeks, maybe one or two month, at best\\n\\nSo I started this project:\\ntrying, as best as ESO\\'s furnishings and my newbie  housing skills allowed me, and as fast as I could, to build the most accurately their  last \"real home\", and make it a \"beach located\" house instead of forest one, because the sea was what helped her through her two previous breast cancers.\\n\\nI hoped that she\\'d be able to see it, if not finished, at least advanced enough that she\\'d recognize it....\\nbut...\\n\\nfive month  later,  though she\\'s stil with us,  she has never been able to see it...\\n\\nshe\\'s not herself anymore, barely remembers most of her life, is now unable to do, if not all, most daily tasks, including feeding herself, cooking, or even going out...\\n\\nI\\'ll finish my project nonetheless\\nbecause she deserves every last bits of it, and it helps me through the whole process of helping her and coming to terms with the situation',},['SizeY']=30,['Z']=95196.324940,['SizeZ']=30,['Contrast']=1,['Id']=1023,['Roll']=0,['Alpha']=0,['Yaw']=6.061530,['EffectType']=8502,['SizeX']=26.456460,['Groups']=0,['X']=96498.937430,},},}"
