R["fx__eu__@ktartyk__79"]="{['TS']=1706654620,['Version']=1773,['Effects']={[1]={['Yaw']=3.141593,['Id']=1007,['EffectType']=8502,['SizeZ']=30,['SizeX']=26.456460,['Groups']=0,['SizeY']=30,['Z']=121849.870592,['Pitch']=5.270894,['Contrast']=4,['MetaData']={['title']='priority target list',['message']='Abnur Tharn, codename \"Daddy-Tharn\" : This one, Kyrah takes care of,  no one comes near him, unless you want to volunteer for one of her experiments !\\n\\nCount Verandis Ravenwatch, codename \"SoftVampy\" : Main source of intel on the Grey host, protect at all cost. May come for tea on Sundas, prepare Sanguin\\'earl grey, and Blood-Biscuits\\n\\nQueen Ayrenn Arana Aldmeri, codename \"BarbieQueen\" : Ally,Kyrah\\'s Sister-BAE, doesn\\'t know about our mission, needs to stay this way. send her a gift for her corronation, no, not a deathhound, too much maintenance, loses bits everywhere\\n\\nNaemon, codename \"Revenant\" :  taken care of, then came back... Kyrah\\'s experimenting on the lich\\n\\n\\n\\nHigh King Emeric, codename \" HeWhoAnnoysMistress\" : No, do not stab him, or poison his wine... don\\'t listen to Kyrah, she\\'s just annoyed...\\n\\nMulaamnir, codename \"FlyingDisaster\" : that damn dragon refuses to die... need for investigation, possible lead, Dragonborn lore.\\n\\nFennorian, codename \"SquishyBoï\" : Great healer, too bad he does not have the presence of mind to use that on himself... walking library with no self confidence. assign a complete unit to its protection, and \"babyproof\" any furnitures he could potentially hurt himself on\\n\\nJorunn the Skald-King, codename \"Jester\" : supposed to be king, spends more time running after women, drinking mead, and singing... in the rare moments he actually rules, shows a surprising talent for diplomacy and leadership. Can prove himself useful in future events. May also be used when throwing a party.',},['X']=108930.057882,['Color']=102439,['Roll']=0,['Y']=33710,['Alpha']=0,},[2]={['Yaw']=0.867430,['Id']=1008,['EffectType']=8502,['SizeZ']=30,['SizeX']=26.456460,['Groups']=0,['SizeY']=30,['Z']=124270,['Pitch']=4.705410,['Contrast']=1,['MetaData']={['title']='reminder for everyone !',['message']='As much as we all enjoy a good game of Tales of Tribute, I find myself in need to clarify something...\\nIn this place, no gambling, or bet of any sort, shall be tolerated !\\nAbsolutely none !\\nLet Brahgas\\'s punishement serves as an example to all...\\nOh,and speaking of which... can someone be a dear,  go to the dungeon, and  release him ?\\nI think a whole month in it has been enough time for self reflection...\\n\\n\\n                         Headmistress, Kyrah Tharn',},['X']=111055,['Color']=719964,['Roll']=0,['Y']=33675,['Alpha']=0,},[3]={['Yaw']=1.570800,['Id']=1001,['EffectType']=8502,['SizeZ']=30,['SizeX']=26.456460,['Groups']=0,['SizeY']=30,['Z']=123407.804862,['Pitch']=5.235990,['Contrast']=1,['MetaData']={['title']='Kyrah THARN\\'s diary, day 118',['message']='I don\\'t understand...\\n\\nNo matter the method used, the reagents, the surgical procedures, every volunteers lose their lives, once I try to extract their anima...\\n\\nHow am I supposed to unravel the mysteries of the soul\\'s composition and origin, and find a way to counter Molag Bal\\'s Planemeld...\\n\\nThose damn test subjects, so weak, so hell-bent on dying at any injuries, absolutely no willpower...\\n\\nI managed to keep one in a semi-comatose state, at least for now, but I fear this is as far as I can push with such feeble vessels...\\n\\nMaybe I should try to alter their bodies first, and put them as close to undeath as possible, by mixing some vampire and werewolf blood together, and infusing them with it...\\n\\nBut I fear it would tarnish the intended result, giving me only hollow husks to work with...',},['X']=107877.842977,['Color']=102439,['Roll']=0,['Y']=33708,['Alpha']=0,},[4]={['Yaw']=2.968805,['Id']=1019,['EffectType']=8502,['SizeZ']=30,['SizeX']=26.456456,['Groups']=0,['SizeY']=30,['Z']=123668.477679,['Pitch']=0,['Contrast']=1,['MetaData']={['title']='kyrah\\'s experiment :  from flesh to trees, diving into botanics',['message']='So far, I\\'ve managed to obtain three positive results, out of the five trials I made !\\n\\nThe first tree, made from the heart of a powerful alpha werewolf, started as a common blue sapling, then grew up, and ended up developping magnificent violet leaves.\\n\\nUsing a vampire\\'s skull and his fangs, allowed me to grow a vibrant blue wisteria, his leaves shining from an eerie glow.\\n\\nThe third experiment was an utter failure ! It turns out that using a sprigan\\'s roots will not only resuscitate said sprigan, but also empower it to the point of awakening as a spriggan earth mother, their most dangerous variants ! getting rid of it proved to be a challenge, and nearly ended poor Fennorian\\'s interest for my studies... I\\'ve taken the remains into my personal laboratory, for further examination.\\n\\nMy fourth attempt was a bit disapointing, I must say...\\nI thought a lich phylactery would make a marvelous white tree, but all I obtained was another blue wisteria, though of a lesser tone and more sinister shine.\\n\\nThough disapointing, this advanced my researches quite a lot , in that it allowed me to conclude that undeads, though of various origins, share a common link, as the trees produced from them were quite similar.\\n\\nAs for my most recent, and most likely final try, a witch\\'s remains is the catalyst, a hagraven head, to be precise. so far, the sapling is of blue color, just like the others in their early stages. his developpement remains to be seen.',},['X']=108659.824203,['Color']=102439,['Roll']=0,['Y']=33769,['Alpha']=0,},[5]={['Yaw']=1.274090,['Id']=1020,['EffectType']=8502,['SizeZ']=30,['SizeX']=26.456456,['Groups']=0,['SizeY']=30,['Z']=125482.688600,['Pitch']=4.886922,['Contrast']=1,['MetaData']={['title']='mission report : track of a woodland creature',['message']='From Neltharya Âraÿa, detached to  House Ravenwatch\\n\\n      To Headmistress Kyrah Tharn\\n\\nThe team I sent to Valenwood came back empty handed.... once more..\\n\\nThey did have some good intel, though...\\n\\nduring their chase, they were able to briefly glance at the mysterious forest dweller we\\'ve been pursuing for almost eight month now.\\n\\naccording to them, it \\'s neither of Mer, nor Men origin, but some sort of tall, pointy eared and horned, entity, that seems to  always ride a mount, as if they were a single being. \\nTheir description seems to be at odd with the countless rumors of a high Faun roaming the forest, as they do not use mounts, but rather use their goat legs to move at high speed....\\n\\nInteresting...\\nI wonder if we may have stumbled upon a completely new intelligent life form !\\n\\nthey were also able to tell me that this peculiar woodland spirit seemed to glow of a soothing blueish or greenish shine, but they weren\\'t quite sure of themselves, as it could very well have been caused by the light coming through the foliage. \\n\\nThey assured me that the mysterious being was peaceful in nature, and seemed to mostly want to be left alone in these woods. \\nAccording to them, they even heard a deep voice, though in an unknown dialect, and a warm laugh seemed to reach into their soulless husks, warming their heart (I had to remind them, that, as thralls, they do not have a heart...).\\n\\nI urged them to go back to their tracking, and bring me the specimen by all means they deemed necessary, alive, and uninjured if possible...',},['X']=111036.966345,['Color']=102439,['Roll']=0,['Y']=33675,['Alpha']=0,},[6]={['Yaw']=3.942699,['Id']=1021,['EffectType']=8502,['SizeZ']=30,['SizeX']=26.456456,['Groups']=0,['SizeY']=30,['Z']=119976.714875,['Pitch']=5.323254,['Contrast']=1,['MetaData']={['title']='Castle\\'s engine\\'s  control pannel',['message']='\\n\\n\\nT° : \\n18°C , Stable\\n\\nNatural light : \\nNone, safe for Vampire tenants\\n\\nSilver detectors : \\nOperational, working at full efficiency\\n\\nMagical  wards :\\nCast, no disturbance in the force\\n\\nBlood supply : \\nBelow half capacity\\n   --> automatic supply request sent \\n   --> expected delivery on Mondas\\n\\nCastle\\'s warp gate : \\nOperational, unauthorized activation detected, outside source\\n\\nWARNING :\\nDecrease in energy level \\nChaurus energy extraction tank faulty\\nautomated repair unit sent',},['X']=107239.069180,['Color']=102439,['Roll']=0,['Y']=33768,['Alpha']=0,},},}"
