R["oh__@dracenfer"]="{['Version']=1773,['Key']='oh__@dracenfer',['TS']=1694669824,['na']={[64]={['O']=18971,['C']=1.012000,['N']='Doomvault Urthemiel',['D']='By Dagon\\'s instruction following the Coldharbour Compact, his cultists created Doomvaults such as this one to reopen doors now closed into the Deadlands. It is unknown what this vault once held, but when discovered its wards deactivated and flooded the hall completely, leaving its true purpose possibly lost forever...',},[34]={['O']=18411,['N']='Dragonguard Hideaway',},[35]={['O']=18977,['C']=1.026000,['N']='Scaled Court Manor',['D']='',},[68]={['O']=18411,['N']='The Mad Cat\\'s Den',},[5]={['O']=18731,['N']='Melody and Harmony',},[38]={['O']=19614,['C']=1.026000,['N']='Tower Guildhall',['D']='This hall contains both Mage\\'s and Fighter\\'s Guild outpost servicing Tel Sanguerre, the settlement named after it\\'s Telvanni tower. This hall is also home to masterwork crafters and an alchemical garden grown within the volcanic rock surrounding Tel Sanguerre. Use EHT to travel between here and the main house attached (my Tel Galen).',},[73]={['O']=18876,['C']=1.024000,['N']='The Half Moon Parlor',['D']='This location offers food and games to large and small parties. While the business fronts as legitimate, high stakes gambling hosted by various Thieves\\' Guild patrons is known to occur in back rooms to those who receive invitations. An unassuming khajiit lives in the single apartment connected, few know what her ties are to the nefarious owners of this business... but those who do know not to cross her.',},[74]={['O']=18411,['N']='Cathedral of Seht',},[43]={['C']=1.021000,['N']='Tel Revas',['O']=18778,},[12]={['O']=18452,['N']='Morag Ruhn',},[45]={['O']=19434,['C']=1.026000,['N']='Tel Sanguerre',['D']='This tower belongs to an ex-Telvanni Magister, exiled for alliances with the Ebonheart Pact and facilitating slave escapes. Despite this, the wards prevent his ousting.\\n\\nThis house is stitched via portals in EHT. Please turn FX on and note that dead ended doors are portals to attached houses. The tower has 4 floors (1 and 4 are the main house, 2 and 3 are my Doomchar). The exterior is meant to match the interior of stitched houses. Please take a look at them!',},[46]={['C']=1.007000,['N']='Sanctum Paravant',['O']=18778,},[15]={['O']=18740,['N']='Wenayasel',},[48]={['O']=19468,['C']=1.026000,['N']='Ensosin-Krasaar Ruin',['D']='The Ruins of Ensosin-Krasaar, the Bewitching Sickness, were once a temple to the dragon priests swayed to choose Peryite as their dragon lord. The reach of this cult back in the height of the dragon era is unknown, however the size of the temple suggests that whatever Peryite offered must have been tempting enough to create this ediface and defend it against the dragons abandoned by these priests.',},[81]={['O']=19313,['C']=1.021000,['N']='The Palace of Muses',['D']='A reclusive proprietor of the arts built a small palace in Western Skyrim. The palace opens infrequently and wealthy patrons are selected through outlaws refuges across tamriel to come bid on the proprietor\\'s paintings. Original works by her hand sell for large sums; however nefarious rumors say not every piece is original...',},[82]={['O']=18912,['C']=1.043000,['N']='Echo of Moonshadow',['D']='(Portal hub to other homes, activate FX please!) A fragment of Azura\\'s plane siphoned off and gifted by Sotha Sil as a nexus for his champion to connect doorways to Nirn.',},[19]={['O']=19285,['N']='Tel Sanguerre, Guest',},[20]={['O']=19449,['C']=1.041000,['N']='Tel Sanguerre Annex',['D']='Constructed alongside the Telvanni tower, this annex serves as a home to the apprentices of Tel Sanguerre who serve the Magister directly.\\n\\nThis house is stitched to my Tel Galen. Please turn FX on and note that dead ended doors are portals to attached houses. This building is meant to continue directly from it\\'s door behind my Tel Galen and it would exist as a part of that house rather than in Narsis. There are portals here to separate houses owned by the apprentices who reside here.',},[85]={['O']=18906,['C']=1.027000,['N']='Lorkh\\'s Aspect',['D']='(Sorry for repost, EHT keeps unlisting it every week or two)\\nThe ashen skies on red mountain make this the perfect hidden sanctum of a powerful vampire experimenting with the essences of Lorkhan eminating from deep within the Red Tower.',},[54]={['O']=18501,['N']='The Forgotten Summit',},[99]={['O']=19600,['C']=1.015000,['N']='Chimer\\'s Glory',['D']='The Vessel \"Chimer\\'s Glory\" is often found docked on Azura\\'s Coast. Belonging to the Magister of Tel Sanguerre, this vessel serves as his flagship for travel across Tamriel and beyond. The cargo hold contains many warded chests filled with powerful relics to be safely secreted away from the hands of misuse.',},[56]={['O']=18908,['C']=1.043000,['N']='Ahrkvolen',['D']='Arkhvolen, the broken hammer, is a well preserved dwarven city created by a clan of dwemer who split from those who would found Volenfell. Recently discovered, this undercity has become the home of some escaping the turmoil above, isolating until the world rests.',},[58]={['O']=18738,['N']='Dibellan Chantry',},[90]={['O']=19450,['C']=1.026000,['N']='Tel Sanguerre (2,3)',['D']='The second and third floors of Tel Sanguerre can be accessed from the library on the first floor. Aside from being the ex-Telvanni Magister\\'s private quarters, the upper level contains a vast, warded chamber where research is conducted at Seht\\'s behest in exploring alternatives to The Heart in an attempt to avoid a possible threat which Sotha Sil has foreseen...\\n\\nThis house is carefully designed inside to match the exterior design of my Tel Galen. Please visit through the portal there!',},[44]={['O']=19412,['N']='Tower Undercity',},[75]={['O']=18879,['C']=1.017000,['N']='Northspire',['D']='When Orsinium was accepted as a territory of the Empire, the potentates had this Consulate built to service the province. When the last potentate fell and the bretons sacked Orsinium, the consul fled out of fear of retribution for the Empire\\'s inaction. Recently, a minor lord was gifted this land and has restored the castle.',},[42]={['O']=18442,['N']='Grand Armiger Suite',},[62]={['O']=18880,['C']=1.020000,['N']='Remnant of Aldmeris',['D']='When Artaeum vanished, the Psijics pulled with it pieces of old Aldmeris. Magic pulled from aetherius flows throughout and gives insights to the order as to how their ancestors once lived before departing to Tamriel.',},[31]={['O']=19472,['C']=1.026000,['N']='Falmeri Sanctum',['D']='(!!! Turn FX on, the door is blocked and replaced with a portal !!!)\\n\\nDeep within the Forgotten Summit (my Pariah\\'s Pinnacle) is the sanctum of the last Snow Elf remaining at the Shrine of Auri-El above. Oathbound to this shrine, he has repurposed the sanctum into his own home as he lives the remainder of his long life in solitude here.\\n\\nThis house is meant to be stitched to my Pariah\\'s build. Please visit @dracenfer Pariah\\'s Pinnacle first if you wish to see the home as it is intended. ',},},}"
