R["oh__@encyclopedique"]="{['eu']={[32]={['N']='Sen\\'s Fortress',['O']=19014,['C']=1.026000,['D']='Dark Souls lovers, here is a recreation of the Sen\\'s Fortress entrance area :)\\n\\nStart in top of the stairs ! \\nEnjoy !',},[70]={['N']='Trésors d\\'Echec',['O']=18966,['C']=1.003000,['D']='Full-scale Chess Game on the right portal, playable with my mates :) \\n\\nHope you will enjoy the idea ! Cheers ',},[7]={['N']='Elven Tree House',['O']=19001,['C']=1.041000,['D']='Wood elves lives in tree houses right?!\\n\\n(Was surprised how tall is the higher point in this little home!)\\nCheck it out :)',},[10]={['N']='Ruines Médiévales',['O']=18989,['C']=1.017000,['D']='A realistic medieval castle ruin in a 200 slots House, check it out ! :)',},[11]={['N']='Rave Party',['O']=18966,['C']=1.016000,['D']='Rave Party has started !!! FREE entrance ! Just come and bring your Joy ! \\n\\nLine UP Mainstage 7/7days :\\n-00AM to 00PM : DJ Nekro (dj set 100% Vinyls) From Old school Dubstep tunes to Modern IDM and Breakcore !\\n\\nDon\\'t forget your garbage bags, and KEEP  our Mother Earth CLEAN ! \\n\\nEnjoy !',},[44]={['N']='Coast Castle',['O']=19047,['C']=1.017000,['D']='Welcome to this ruined castle ! Come and visit this historical site :)\\n\\nCheers',},[14]={['N']='L\\'Emboisée',['O']=18966,['C']=1.031000,['D']='Welcome to my Tree House ! Hope you\"ll enjoy it !',},[47]={['N']='Seath the Scaleless',['O']=18966,['C']=1.020000,['D']='Welcome to this Dark Souls inspired project ! \\n\\n\"Primoridal Crystal of Seath the Scaleless\" \\n\\nDont miss the upstairs, there is a surprise ! ',},[81]={['N']='River\\'s Path',['C']=1.031000,['O']=19407,['D']='Hello !\\n\\nHere is a realistic landscape build i made of a lovely watercourse with some medieval buildings (village and castle tower on the moutain top)\\n\\nWanted to give a real painting looking, where you can walk around and enjoy the peacefullness of the place :)\\n\\nAdded the alkosh hourglass, so you can change the hour and enjoy the boreal sky on the night. \\n\\nHope you\\'ll enjoy :) ',},[20]={['N']='Path to the Church',['O']=18998,['C']=1.041000,['D']='A path from the sewers to a lovely church in top of the mountains ! Don\\'t miss the outside! \\nCheers :)',},[49]={['N']='Ancient Church ',['O']=18989,['C']=1.037000,['D']='A realistic forgotten church into a ruins style !\\r\\n\\r\\nStructures have fallen into a state of partial destruction due to the naturals phenomena and the time that make its work. The ancient civilisation who built it already knew the basics principles of architectura, but no one in Tamriel have any idea of what this construction has made for, and what this Cross symbol means.. Still a mystery today.\\r\\n\\r\\n(Don\\'t miss the 2 sides of the building)\\r\\n\\r\\nCheers ! ',},[78]={['N']='Attack on Titan',['O']=19407,['C']=1.017000,['D']='Hello there !\\n\\nHere is a fantastic petrified warfare build i made in the little patio of this house. Solitude is under attack, and burn from the mysterious giant\\'s assault.\\n\\nYou are a soldier and you need to defend the walls, take your weapons at the forge and be ready to counter thoses creatures !! :)\\n\\nEnjoy ! ',},[12]={['N']='Firelink Shrine ',['O']=18979,['C']=1.026000,['D']='Dark Souls lovers, welcome to my Firelink Shrine remake in another time-space dimension :D\\n\\nTake a seat at the bonfire, charge your estus flasks and be ready for the next fight ! :) ',},[59]={['N']='Maison des Sciences',['O']=18966,['C']=1.030000,['D']='Welcome to my dedicated house to the Sciences. Archeology, Geology and Astronomy are studied here ! \\nWith a bit of botany :)',},[25]={['N']='Glass Crystal Mine',['O']=19322,['C']=1.017000,['D']='Here is a little dark castle build i made on this little slots area, hope you will enjoy ! \\n\\ncheers !',},[26]={['N']='Autumn Leaves',['O']=18995,['C']=1.041000,['D']='Welcome to this little mountain village. Be careful to not slip on the leaves, we are in the fall season ! :)',},[27]={['N']='Sources Elfiques',['O']=18995,['C']=1.041000,['D']='A lovely elfic village, into a hobbit style !\\n\\nTotally inspired by the incredible \"Fantasy Bosmer\" of @lovathy ! ',},[28]={['N']='Chill\\r Birch Forest',['O']=19359,['C']=1.033000,['D']='Hi there ! \\nHere is a little house in a lovely forest !\\n\\n(Reupload, i removed it from the hub by mistake !)',},[17]={['N']='Au Pied du Mur',['O']=19313,['C']=1.017000,['D']='Hi there ! \\n\\nHere is a realistic fantasy castle build i made in this limited slot area.\\n\\nYou start in the moat so make sure to bring your boots !\\n\\ncheers !',},[30]={['N']='Hilltop Castle ',['O']=19407,['C']=1.017000,['D']='Hi there ! Here is a realistic hilltop castle build i made with some nice landscape  :)\\n\\nWanted to make something with a really strong gigantism feeling.\\nDont miss the crystal cave, and the littles easter eggs hided around ! :)\\n\\nAdded the Alkosh Hourglass, so you can enjoy the build at any time you want.\\n\\nEnjoy ! \\n\\nReupload',},[43]={['N']='Mushroom Village',['O']=19029,['C']=1.041000,['D']='Welcome to this little mushroom village !\\n\\nDont miss the spiral  stairs to get the highest point of view :)',},},['TS']=1676818901,['Version']=1771,['Key']='oh__@encyclopedique',}"
