R["oh__@lorkay"]="{['na']={[8]={['D']='A young witches home. She is trying to get her powers perfected and things go wrong upstairs.  She goes out to get answers.',['C']=1.038000,['O']=19235,['N']='Halloween House',},[75]={['D']='This is the perfect place for couples for a romantic holiday or for the group parties.  Features a large swimming hole at the top of the falls and a honeymoon cabin on the docks.  Come and enjoy the calming nature of the falling water.',['C']=1.021000,['O']=19235,['N']='Romantic Retreat',},[20]={['D']='Bed and Breakfast.  Features an enchanted beadroom on top floor, library, a 70\\'s vibe beadroom with a sunken bed a Zen room in the basement, an eat in kitchen and a Grand entrance hall.  All are welcome.',['C']=1.020000,['O']=19235,['N']='Bed and Breakfast',},[13]={['D']='Come and be the Captain on the bridge in your very own space ship.  Don\\'t worry about the navigator and pilot, they are having a heated discussion.  They will work it out and get you where you want to go.  ',['C']=1.032000,['O']=19235,['N']='Space Ship',},[70]={['D']='This house features a walk-in aquarium in the north portal room, a large garden out the east portal room.  Bothe of these room are designed to make you feel very peacful... however you need to deal with the very intense and scary, Princ of Ambition, crashing through the front room ',['C']=1.012000,['O']=19235,['N']='Rimmen Temple',},[11]={['D']='You will be greeted by a very big happy boy.  He is a mudman not snowman because it don\\'t snow here.  He was so ecxited to celebrate the Holiday that he took the flowering tree and shook it to mimic snow.  A wacky holiday home.',['C']=1.022000,['O']=19235,['N']='MudMan',},},['Key']='oh__@lorkay',['TS']=1661989510,['Version']=1769,}"
