R["fx__eu__@queenofbabylon__69"]="{['Version']=1767,['Effects']={[1]={['Id']=1009,['Pitch']=4.974188,['Groups']=0,['Color']=194873,['Z']=36657.181348,['MetaData']={['title']='Über dieses Gildenheim',['message']='Als die Gilde im Juni 2020 gegründet wurde und ich immer mehr beeindruckend eingerichtete Häuser gesehen habe, habe ich gesagt, dass wir nicht ein Gildenhaus haben, sondern hunderte!\\n\\nSeitdem wurden die Rufe nach einem eigenen Gildenhaus immer lauter und  so haben wir uns an die Arbeit gemacht und das Projekt \"Gildenheim\" geplant. \\n\\nWie es bei uns üblich ist, ist die Umsetzung so eines Projekts keine Einzelleistung, sondern Teamarbeit. Über einen kleinen Housing-Wettbewerb haben wir eine tolle Truppe zusammengestellt, die hier gemeinsam gezaubert hat. Diese Menschen haben hier wirklich großartiges geleistet! Das Haus repräsentiert alles, was unsere Gilde ausmacht.\\n\\n\\n\\n\\n\\n\\n\\n\\nAn dieser Stelle möchten wir unsere Teammitglieder ehren:\\n@Belmere\\n@Claras\\n@DelwaraTelorandis\\n@Eden666\\n@LOUP226\\n@python1980\\n@Rubitete\\n@Walista\\n\\nVielen Dank! Es war wirklich eine Freude, mit euch zusammenzuarbeiten!\\n\\nEure Gildenleitung,\\n@QueenOfBabylon & @Selenchen11',},['SizeY']=70,['X']=103572.729424,['SizeX']=48.456456,['Alpha']=1,['Roll']=0,['SizeZ']=70,['EffectType']=8503,['Y']=30729,['Yaw']=4.799655,['Contrast']=1.500000,},},['TS']=1638481201,}"
