R["fx__na__@dracenfer__46"]="{['Effects']={[1]={['Roll']=0,['Y']=14783,['Alpha']=1,['MetaData']={['message']='Torn between banners of the Three Banners\\' War, an order of knights split from the thorns of the rose to fight for the Dominion. The Knight Commander and Knight Magister of Knights Paravant led the charge to engage the toughest of enemies known to this war with many victories to their name. A spell on this rose keeps it from withering, the last monument of an order split to the winds and a war that still wages.\\n\\nThe Knights Paravant dawned from a company of mercenaries, Vehemence. These mercenaries long partook in the war, reaping the spoils from fighting for each side and perpetuating this unending conflict. Many were consumed by their rage, a thorny rose piercing deep into the terriroty of the alliances. From this company, the most devoted desired to dedicate to the Dominion, seeking to be heroes of one side rather than profiteers seeking victory blind to the banner it was won under. The Knights Paravant were born, fewer in number, but stronger in unity.\\n\\nThrough many engagements, these warriors were the tip of the spear for those long relenting many defeats at the hands of other organized knights and sellswords. The Knights Paravant achieved many victories over the toughest foes to step foot within Cyrodiil and all the while remaining under one banner. Despite their efforts, the war raged and this new world seemed to perpetuate inevitably. This monument serves to honor the dedication and hunger for victory each Knight Paravant brought to the whole. Their union was a bond which will long be remembered as one shaping the Three Banners\\' War as long as time will recall.',['title']='The Knights of Paravant',},['Id']=1100,['SizeZ']=30,['Contrast']=1,['Color']=102439,['Z']=86523.230433,['SizeY']=30,['X']=57083.752850,['EffectType']=8501,['Pitch']=4.712564,['Groups']=0,['SizeX']=26.456456,['Yaw']=0.052360,},},['TS']=1644462543,['Version']=1767,}"
