R["oh__@julia_tarrel"]="{['Key']='oh__@julia_tarrel',['Version']=1767,['na']={[1]={['O']=18842,['N']='Vulkhel Guard Inn',['D']='The inn called Mara\\'s Kiss has no space for a couple to have a quiet, relaxed meal with noone to disturb them.\\nNow it does. This room.',['C']=1.013000,},[23]={['O']=18842,['N']='Rawl\\'kha House',['D']='Tasimba-daro is a comfortably well-off Khajiit of little fame. Intentionally. She has observed that those who seek fame rarely live comfortable lives.\\nSo her home is modest, at least on the outside. And if her moon sugar pipe sometimes has skooma in it, who is to say?',['C']=1.026000,},[62]={['O']=18842,['N']='Artaeum Manor',['D']='This is a showroom of furnishings I - and others - can craft.\\nThe furnishings outside the main building are arranged by race, or lack thereof. (Provisioning is its own section.)\\nI have a set of crafting tables for you to use, if you have the recipe/pattern/whatever.\\nI hope this is useful.',['C']=1.004000,},[75]={['O']=18842,['N']='Wrothgar Village',['D']='Shazek Stonebreaker has achieved mastery as a smith and has a small school tucked away near Morkal in Wrothgar.\\nShe resides in the house, with the rest of the school\\'s residences are in the longhouse. The teacher and her mate live in one end, and the apprentices in a dormitory at the other end.\\nAt the top of the home is a sculpture to Malacath (aka Mauloch), and a stele engraved with prayers.',['C']=1.041000,},},['TS']=1638600546,}"
